import React from 'react';
import PageTitle from '../../PageTitle';
import Rules from './Rules';
import Settings from './Settings';

const InactiveGame = ({ handleGameStart, handleLengthChange, gameLength }) => {
  return (
    <>
      <PageTitle>Math Blitz</PageTitle>
      <Rules />
      <Settings handleGameStart={handleGameStart} gameLength={gameLength} handleLengthChange={handleLengthChange} />
    </>
  );
};

export default InactiveGame;
